import React from 'react';
import { useDroppable } from '@dnd-kit/core';

const Droppable = ({ items }) => {
	const { setNodeRef } = useDroppable({
		id: "droppable"
	});

	return (
		<ul ref={setNodeRef}>
		{items.map((item, idx) => (
			<div key={`${item}-${idx}`}>
				{item}
			</div>
		))}
		</ul>
	);
};

export default Droppable;
